There is a dismissive grunt from POLAR CLAW as he looked back over the
information on his PADD. He may not be as large as TUSCON, from the
way he carried himself he looked well able to carry his own load in a
battle.

He looked over at RAMULUS and then WOLFGANG, both of whom look really
comfortable taking orders from him as if they both have served under
him for a while. With a jerk of his head he sent them both into the
shuttle, leaving PROWL and POLAR CLAW outside.

PROWL stood looking at NIGHTSHIFT, his head tilting curiously at him.
&quot;Do you normally fear your commander so much that you would obey a
command that may get him into trouble?&quot;

A grunt from POLAR CLAW, &quot;If you wish to be left behind speak up or
gear up.&quot; He jerked a finger at the shuttle.

